import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Header } from '../../components/header/Header';
import { Post } from '../../components/post/Post';
import { TabList } from '../../components/profileTabList/TabList';
import { MessageList } from '../../components/messageList/MessageList';
import { MessageDetail } from '../../components/messageList/MessageDetail';
import { Box, Container, Divider, Paper } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1
    },
    nonePadding: {
        padding: "0!important"
    }
}));

export function Mess() {
    const classes = useStyles();

    return (
        <Container>
            <Grid container spacing={3} >
                <Grid item xs={12} className={classes.nonePadding}>
                    <Header></Header>
                </Grid>
                <Grid container style={{ marginTop: "100px" }}>
                    <Grid item xs={4} style={{ padding: "1%" }}>
                        <Paper style={{height:"100%"}}>
                            <MessageList></MessageList>
                        </Paper>
                    </Grid>
                    <Grid item xs={8} style={{ padding: "1%" }}>
                        <MessageDetail></MessageDetail>
                    </Grid>
                </Grid>
            </Grid>
        </Container >
    );
}
